const weights = [5, 4, 3, 2, 7, 6, 5, 4, 3, 2];

function validateKontonummerMod11(kontonummer) {
  const kontonummerWithoutSpacesAndPeriods = kontonummer.replace(/[\s.]+/g, '');
  if (kontonummerWithoutSpacesAndPeriods.length !== 11) {
    return false;
  } else {
    const sjekksiffer = Number.parseInt(
      kontonummerWithoutSpacesAndPeriods.charAt(10)
    );
    const kontonummerUtenSjekksiffer = kontonummerWithoutSpacesAndPeriods.substring(
      0,
      10
    );

    let sum = 0;
    for (let index = 0; index < 10; index++) {
      sum +=
        Number.parseInt(kontonummerUtenSjekksiffer.charAt(index)) *
        weights[index];
    }

    const computedSjekksiffer = 11 - (sum % 11);

    return computedSjekksiffer === sjekksiffer;
  }
}
